import React, {Component} from 'react'
import Mobiles from './components/phones';
import './App.css'

class App extends Component {

  state = {
      mobiles: []
  };

  componentDidMount() {
      fetch('http://localhost:8080/phones')
          .then(res => res.json())
          .then((data) => {
              this.setState({ mobiles: data })
          })
          .catch(console.log)
  }
  render() {
    return (
        <Mobiles mobiles={this.state.mobiles} />
    )
}
}

export default App;
